void calc(int n)
{
  int ch,i,cnt_old,ch2,c2,pr,pr2;

  pr=p[n];
  //printf("no=%d pr=%d\n",n,pr);

  if(pr % 1000 == 0)
    {
      memcpy(&inf[cnt],&inf[0],sizeof(struct k_inf_st)*cnt);
      //dump(cnt*2);
      cnt_old=cnt;
      cnt *= 2;
      for(i=cnt_old;i<cnt_old*2;i++)
	  {
	    inf[i].change = inf[i].change + 500;
	    inf[i].c500 ++;
	    inf[i].amount += pr;
	  }
    }
  else if(pr % 1000 <= 500)
    {
      ch = 500 - (pr % 1000);
      for(i=0;i<=cnt;i++)
	{
	  inf[i].change = max(0,inf[i].change - ch);
	  inf[i].c500 ++;
	  inf[i].amount += pr;
	}
    }
  else
    {
      ch = (pr % 1000) - 500;
      memcpy(&inf[cnt],&inf[0],sizeof(struct k_inf_st)*cnt);
      //dump(cnt*2);
      cnt_old=cnt;
      cnt *= 2;
      for(i=cnt_old;i<cnt_old*2;i++)
	{
	  inf[i].change += ch;
	  ch2 = inf[i].change;

	  c2  = inf[i].c500;
	  inf[i].c500++;

	  inf[i].amount += pr;
	  pr2 = inf[i].amount;

	  //printf("** [%d] [%d]\n",ch,c2);
	  if(ch2 >= 500 && c2 > 0)
	    {
	      memcpy(&inf[cnt],&inf[1],sizeof(struct k_inf_st));
	      inf[cnt].change = ch2 - 500;
	      inf[cnt].c500   = c2;
	      inf[cnt].amount = pr2;
	      cnt ++;
	    }
	  else if(ch2 < 500 && c2 > 0)
	    {
	      memcpy(&inf[cnt],&inf[1],sizeof(struct k_inf_st));
	      inf[cnt].change = 0;
	      inf[cnt].c500   = c2;
	      inf[cnt].amount = pr2;
	      cnt ++;
	    }
	}
      //dump(cnt);
    }
  qsort(inf,cnt,sizeof(struct k_inf_st),compare_st);
  shrink();
  //dump(cnt);
}
